// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.7.0;

contract Sample {
    address owner;
    event IsAdded(bool done,string emitted);
    struct product {
        string brand;
        string model;
        address ownedBy;
        bool exists;
    }

    // A struct which helps create a new customer
    struct customer {
        string name;
        string phone;
        bool isValid;
    }

    struct retailer {
        string name;
        string location;
    }

    mapping(string => product) products;
    mapping(address => customer) customers;
    mapping(string => retailer) retailers;

    // Function to add a new product
    function addProduct(
        string memory _id,
        string memory _brand,
        string memory _model
    ) public {
        product memory newProduct;
        newProduct.brand = _brand;
        newProduct.model = _model;
        newProduct.ownedBy = msg.sender;
        newProduct.exists = true;
        products[_id] = newProduct;

        bool done = true;
        emit IsAdded(done,"customer added");
    }

    // Function to fetch product details
    function getProduct(string memory _id)
        public view
        returns (
            string memory id,
            string memory brand,
            string memory model,
            address ownedBy
        )
    {
        if (products[_id].exists) {
            // products[_id].scannedBy.push(msg.sender);
            return (_id, products[_id].brand, products[_id].model,products[_id].ownedBy);
        }
        // return ("", "", "",);
    }

    function addCustomer(string memory _name, string memory _phone)
        public
        returns (string memory response)
    {
        response = "Already Exists";
        if (customers[msg.sender].isValid != true) {
            customer memory newCustomer;
            newCustomer.name = _name;
            newCustomer.phone = _phone;
            newCustomer.isValid = true;
            response = "New Customer Added";
            return response;
        }
        return response;
    }

